import React from 'react';
import './Nav.css';
import pit from '../img/pit.jpg';
import { BrowserRouter as Router} from "react-router-dom";



class CNav extends React.Component {
    constructor(props){
        super(props);
        this.state={
            search:null
        }
        this.searchProducts= this.searchProducts.bind(this)
        this.search=this.search.bind(this)
    }
    searchProducts(event){
        event.preventDefault();
    }
    search(event){
        this.setState({
            search: event.target.value
          });
    }
    render() {
    return (<Router>
        <div class="home">
            <div class="nav">
                <ul>
                    <li><a class="active" href="/"><img alt="sorry" height="120%" width="15%" src={pit}/></a></li>
                    <li><a class="links" href="/login">LogOut</a></li>
                    <li><a class="links" href="/cart">MyCart</a></li>
                    <li><a class="links" href="/profile">MyProfile</a></li>
                    <li><input type="text" placeholder="Search products.." value={this.state.search} onChange={this.search}class="searchlink"/><button class="search" onClick={this.searchProducts}> Search </button></li>
                </ul>
            </div>  
          </div>
        </Router>
    );
    }
}
export default CNav;
